import React from "react";
import { Card } from "../../Card.styled";
import { ImageCard } from "../../ImageCard.styled";
const Grid2 = ({ content }) => {
  const renderedContents = content.trendingAuctions.map((element) => {
    return (
      <Card mg={"2rem 0rem"} height={"14rem"} bd={"1px solid red"}>
        <Card mg={"1rem"}>{element.tag}</Card>
      </Card>
    );
  });
  return (
    <>
      <Card bd={"1px solid red"}>
        <Card dp={"grid"} gridC={"33.333% 33.333% 33.333%"}>
          {renderedContents}
        </Card>
      </Card>
    </>
  );
};

export default Grid2;
